(1192, 567, '950924302', '92.51.77.242', 1459922388, 1459922388, 1459922626, 25, '109', 'აჭარის ხარიტონ ახვლედიანის სახელობის მუზეუმი', '', 'ჯინჭარაძის ქ. # 4', 'მუზეუმის სამეცნიერო-საგანმანათლებლო  განყოფილების გამგე : 555 534846 - რუსუდან კუბრავა ;  კოორდინატორი: 595 515565- მადონა ჭრელაშვილი', '', 'ოთარ გოგოლიშვილი - 593 61 78 95', '', 'adjaramuseums.ge ', '', '', '', '', '', '', '', '', 'მუზეუმში დაცულია ძვ. წ. XII – IX სს-ის, აგრეთვე VII - IV სს.უნიკალური\n არქეოლოგიური მასალები: ანტიკური პერიოდის ბერძნული შავლაკიანი კრატერი, \nგრავირებული ცულები, ე. წ. გონიოს განძის მასალები (ძვ. წ. V ს.). მათ შორის, სხვადასხვა\n სახის, ფორმისა და ზომის ძველი ქართული ოქრომჭედლობის\n ნიმუშები: ინტალიო აფროდიტეს და ეროსის გამოსახულებით, ბადროსმტყორცნელის\n (დისკობოლი) ფიგურა, გულსაკიდები, სხვადასხვა მასალისგან დამზადებული მძივები,\nკილიტები, გულსაბნევები, საკულტო დანიშნულების სკულპტურები (ბრინჯაო), \nაგრეთვე: ბუნების იშვიათიძეგლები, XIX-XX სს-ის მიჯნის ეთნოგრაფიული,\n ხალხური და გამოყენებითი ხელოვნების ნიმუშები,ხელნაწერები, \nსახვითი ხელოვნების ნიმუშები.', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '0422 27 11 75 ; 0422 27 11 70 ;', '', '', '', '', '', '', 213, ',213', 549, 1, 2, 0),
