(1636, 789, '598035031', '92.51.77.242', 1460356335, 1460356335, 0, 25, '161', 'მაჭახლობა', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '23-30 სექტემბერი', '', '', '', '', '', 'მაჭახელა,  სოფელი ზედა ჩხუტუნეთი', '', '', 'სახალხო დღესასწაული 2007 წლიდან იმართება, და ამ დღესასწაულის დღეს ზედა (თურქეთი) მაჭახლის და ქვედა (საქართველო) მაჭახლის მცხოვრებლები\n ხვდებიან ერთმანეთს.\n ტრადიციულად არის გამოფენები, ხალხური რეწვის ნუმუშები,  ღონისძიების დღეს ვლინდება ,,საპატიო მაჭახლელი”,\n ხოლო მობრძანებულ სტუმრებს გადაეცემათ საჩუქრად ,,მაჭახლის ქამარი”.\nტრანსპორტი: ავტომანქანა, ავტობუსი\nღირშესანიშნაობები: მაჭახლის ბუნება, საპიკნიკე ადგილები, ნახოს თაღოვანი ხიდები და გვარას ციხე, ასევე მაჭახლის ისტორიულ ეთნოგრაფიული მუზეუმი.', '', '', 213, '', 764, 1, 2, 0),
